import React, {useState, useEffect} from 'react';
import axios from 'axios'

function Dashboard() {
  const[ordini, setOrdini] = useState([])
  useEffect(() => {
      axios.get('http://127.0.0.1:8000/ordinazioni/',[])
      .then(res => {
          console.log(res)
          setOrdini(res.data)
      },)
      .catch(err =>{
          console.log(err)
      })
  },[])
  return (
     
    <div >
        <ul>
      {
          ordini.map(ordini =><div clas="raw"><li key={ordini.id}>{ordini.nome_prenot} - {ordini.totale} <button>Accetta</button> <button>Consegnato</button></li></div> )
      }
      </ul>
    </div>
  );
}

export default Dashboard;
